- input: "TEXT\x1CC00437251\x1CX0\x1C\x1CF3A\x1CDear Madame or Sir,        This amendment
    corrects some errors which became apparent in responding to the FEC's letter to
    the campaign of 1/29/08.    First, this amendment corrects the total contributions
    figure reported on the campaign's Amended 3rd quarter report.  This figure had
    been accidentally changed when a code field in our accounting and reporting software
    (NGP) was not adjusted appropriately.  The result was that 4 $2300 contributions
    designated for the general election which were reported in the campaign's original
    3rd quarter report were not reported in the amendment.  Thus, the total contributions
    for the 2008 cycle reported in the original report was accurate, and this amendment
    reflects that.       Next, a $1500 expenditure for the NGP software referred to
    above was not previously reported in the 3rd quarter and is reported here.        Please
    let me know if you have any questions or concerns.        Very truly yours,    Samuel
    Melei  Treasurer    Citizens for Robert Abboud"
